Some technical skills are needed to get set up, it requires you to use command line to run a couple of commands. Btw, be aware of of scammers reaching out as they might target new people.

@WiseOwl [ψ] is the go to person for help on this.

You can find instructions on how to mine at: [wize0wl](https://github.com/NuanceNetwork/Nuance)

Not seeing anything. Tried these valis using ip + port from metagraph.
@Tuan Dao @DecentDev [τ, ψ] 

```
$validators = @(
    "64.23.176.29:8091",
    "132.145.134.96:8094",
    "195.189.97.59:40170",
    "136.61.20.181:10001",
    "192.150.253.124:11023",
    "34.130.152.26:8091",
    "84.32.70.36:9877",
    "18.117.72.144:6670",
    "129.146.164.160:8091"
)

$minerHotkey = "<place-hotkey-here>"

# Test each validator
foreach ($validator in $validators) {
    $url = "http://$validator/miners/$minerHotkey/stats"
    try {
        $response = Invoke-WebRequest -Uri $url -UseBasicParsing -TimeoutSec 30
        if ($response.StatusCode -eq 200) {
            Write-Host "[+] API found at $validator" -ForegroundColor Green
        } else {
            Write-Host "[-] $validator responded with status code $($response.StatusCode)" -ForegroundColor Yellow
        }
    } catch {
        Write-Host "[-] No response from $validator" -ForegroundColor Red
    }
}```

